  return (
    <div className='container login-container'>
        <div className="row">
            <div className="col-md-7 border border-primary">
                <img src={socialDesktop} alt='Social Desktop'/>
            </div>
            <div className="col-md-5 border border-danger">
                form
            </div>
        </div>
    </div>
  )
}

export default Login
